import React, { Component } from 'react';
import './App.css';

import photo1 from './photos/ushguli.jpg';

class App extends Component {
  render() {
    return (
      <div className="App">
        <MyTravelHistory
          destination="Ushguli"
          country="Georgia"
          photo={photo1}
          distance="3.122Km"
        />
      </div>
    );
  }
}

export default App;

const MyTravelHistory = ({ destination, country, photo, distance }) => (
  <figure>
    <img className="image" src={photo} />
    <figcaption>
      <blockquote>{destination}</blockquote>
      <blockquote>{country}</blockquote>
      <cite>{distance}</cite>
    </figcaption>
  </figure>
);
